import './workList.css';
import Work from '../work/Work';

const WorkList = () => {
    return (
        <div className="workList">
            <div className="workList-text">
                <h1 className="workList-title">Here's some of my work</h1>
                <p className="workList-description"> Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque sit amet pellentesque dolor. Suspendisse potenti. In blandit elementum ligula vitae porta.</p>
            </div>
            <div className="workList-list">
                <Work/>
            </div>
        </div>
    )
}

export default WorkList;
